import React from "react";

function Delivery() {

  const handlePlaceOrder = () => {
      alert("Succesfully placed you order");
  };

  return (
    <div>
      <form onSubmit={handleRegister}>
        <h2>AJIO</h2>
        <div className="links">
            <h4>Register</h4>
          <div className="dash">|</div>
            <h4>Login</h4>
        </div>
        <input
          type="text"
          name="username"
          placeholder="Username"
          required
          onChange={handleChange}
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          required
          onChange={handleChange}
        />
        <input
          type="password"
          name="password"
          placeholder="Password"
          required
          onChange={handleChange}
        />
        <br />
        <button>Register</button>
      </form>
    </div>
  );
}

export default Delivery;
